import React from 'react';

const Contact = () => {
  return (
    <div>
      <h2>联系方式</h2>

      <div className="contact-info">
        <h3>学术邮箱</h3>
        <p>email: ziwang@university.edu</p>

        <h3>办公地址</h3>
        <p>某大学社会科学学院政治学系</p>
        <p>中国 北京市 海淀区 某路100号</p>
        <p>邮编: 100000</p>

        <h3>社交媒体</h3>
        <p>
          <a href="https://twitter.com/example" target="_blank" rel="noreferrer">Twitter</a> | 
          <a href="https://scholar.google.com/example" target="_blank" rel="noreferrer"> Google Scholar</a> | 
          <a href="https://researchgate.net/example" target="_blank" rel="noreferrer"> ResearchGate</a>
        </p>

        <h3>办公时间</h3>
        <p>周一至周五: 上午10:00 - 下午4:00</p>
        <p>请提前通过邮件预约</p>
      </div>
    </div>
  );
};

export default Contact;
